import styles from './work.module.scss';
import { motion } from 'framer-motion';

const blockAnimation = {
    hidden: {
        opacity: 0,
    },
    visible: custom => ({
        opacity: 1,
        transition: { delay: custom * 0.2 },
    }),
}

function Work() {
    return (
        <section className={styles.work__main}>
            <h1 className="p-4 text-center text-white font-bold text-4xl">Мои работы</h1>
            <motion.div
                initial="hidden"
                whileInView="visible"
                viewport={{ amount: 0.2 }}
                className={styles.work}>
                <motion.a
                    custom={1}
                    variants={blockAnimation}
                    href="https://superstasbox.ru/">
                    <img src="https://i.imgur.com/jiJoN7i.png" alt="work" />
                </motion.a>
                <a href="https://pizza-react-app.vercel.app/">
                    <img src="https://i.imgur.com/3wtKlKP.png" alt="work" />
                </a>
                <a href="https://karbonara.github.io/get-smm/index.html#">
                    <img src="https://i.imgur.com/HyXjBlG.png" alt="work" />
                </a>
                <a href="https://karbonara.github.io/site_csgo-case/index.html">
                    <img src="https://i.imgur.com/9RfGyej.png" alt="work" />
                </a>
                <a href="https://karbonara.github.io/up-steam/">
                    <img src="https://i.imgur.com/2n9aU5L.png" alt="work" />
                </a>
                <a href="https://karbonara.github.io/up-games/">
                    <img src="https://i.imgur.com/AqEmdyU.png" alt="work" />
                </a>
                <a href="https://karbonara.github.io/up-games/">
                    <img src="https://i.imgur.com/QxFonDc.png" alt="work" />
                </a>
                <a href="https://karbonara.github.io/incorn/">
                    <img src="https://i.imgur.com/APfA541.png" alt="work" />
                </a>
            </motion.div>
        </section>
    );
}

export default Work;
